import Box from '@mui/material/Box';
// import Button from "@mui/material/Button";
import Container from "@mui/material/Container";

function App() {
  return (
    <Grid container columns = {{xs:8}}>
      {Array(8).fill(0).map((_, i) => (
        <Container>

        { Array(8).fill(0).map((_, j) => (
          <Box>
            {i} {j}
          </Box>
        ))}
        </Container>
      ))}
    </Grid>
  );
}

export default App;
